Assignment:
  Assignment_1:
    title: 'Research about how artificial intelligence has impacted the computer industry'
    AssignmentGroup: AssignmentGroup_2
    task_description: 'In this assignment we would like you to investigate how artificial intelligence has impacted our computer industry. We all know that AI is a recent branch of computing and still has more room for researchers to research about. So we''re encouraging you to engage with your fellow students and come up with 1000 words essay about your view of this new field.'
