Course:
  Course_1:
    name: 'Human Computer Interaction'
    code: SCS145
    Department: Department_1
    description: '<p>Through lectures and a project, learn the fundamentals of human-computer interaction &amp; design thinking. Work together in teams of three on a quarter-long project. Each week, in small design studios, present and discuss work with peers. The setting for the course is mobile web applications. The constraints of this small form factor make this an exciting challenge. At the end of the course, present to a jury of IT and design leaders. CS147L, an optional 1-unit lab teaches web programming. Projects should address one of the following three brief.</p>'
